def add_parts():
    """Add additional parts to the database."""
    Base.metadata.create_all(bind=engine)

    db = SessionLocal()
    added = 0
    skipped = 0

    try:
        for part_data in ADDITIONAL_PARTS:
            # Check if part already exists
            existing = db.query(Part).filter(Part.name == part_data["name"]).first()
            if existing:
                skipped += 1
                continue

            part = Part(**part_data)
            db.add(part)
            added += 1

        db.commit()
        print(f"Added {added} new parts ({skipped} already existed)")

        # Print summary by type
        for ptype in ["promoter", "rbs", "terminator", "gene"]:
            count = sum(1 for p in ADDITIONAL_PARTS if p["type"] == ptype)
            print(f"  - {count} {ptype}s")

    finally:
        db.close()


if __name__ == "__main__":
    add_parts()
